// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

// 抽象合约至少包含一个抽象方法，抽象方法必须使用virtual修饰，等待子合约实现
abstract contract Sorter {
    function sort(uint256[] memory array)
        public
        pure
        virtual
        returns (uint256[] memory);
}

contract BubbleSorter is Sorter {
    function sort(uint256[] memory array)
        public
        pure
        override
        returns (uint256[] memory)
    {
        for (uint256 i = 0; i < array.length - 1; i++) {
            for (uint256 j = 0; j < array.length - i - 1; j++) {
                if (array[j] > array[j + 1]) {
                    uint256 temp = array[j + 1];
                    array[j + 1] = array[j];
                    array[j] = temp;
                }
            }
        }
        return array;
    }
}

// 接口定义规则
// 1. 不能包含状态变量
// 2. 不能包含构造函数
// 3. 所有函数必须是external且不能有函数体
// 4. 不能继承除接口外的其他合约
// 5. 继承接口的非抽象合约必须实现接口的所有方法
interface Person {
    function getFirstName() external pure returns (string memory);

    function getLastName() external pure returns (string memory);
}

contract ManPerson is Person {
    function getFirstName() external pure override returns (string memory) {
        return "Yao";
    }

    function getLastName() external pure override returns (string memory) {
        return "FengQiao";
    }
}

